import React from 'react'
import  {BrowserRouter as Link, NavLink} from 'react-router-dom';
function Home() {
  return (
  <div>
    <>
      <NavLink to='/about'><h1>About</h1></NavLink>
      <NavLink to='/about'><h1>About</h1></NavLink>
      <NavLink to='/contact'><h1>Contact</h1></NavLink>
    </>
  </div>
  )
}

export default Home
